import React from 'react'
import './Checkbox.scss';

export const CheckBox = props => {
    return (
        <li>
        <div className="container">
          <input type="checkbox" onChange={props.handleCheckElement} checked={props.isChecked} value="checked" />
          <label for="php">{props.value}</label>
        </div>
      </li>
    )
}

export default CheckBox
